export default function PersonalLogin() {
    return (
        <div id="container">
          <div id="logo">
              <div className="centrado">
                  <div className="Resto"></div>
                  <div className="bloque">
                      <button className="boton">CLIENTE</button>
                      <button className="boton">PERSONAL</button>
                  </div>  
              </div>
          </div>
        </div>
      );
}
